import React from 'react';
import './Ebook.css' ;
import Switch from 'react-bootstrap/esm/Switch';
import { Route } from 'react-router-dom';
import { Tab } from '.ejournal/tab/Tab';
const styles = {
  fontFamily: 'sans-serif',
};

export class Ebook extends React.Component {
  constructor(props) {
    super(props);
    this.state = {active: 'aTab'};
  }
  render() {
    const content = {
      aTab: 'Tab A',
      bTab: 'Tab B',
      cTab: 'Tab C',
    };
      return (
          <>
        <br></br>  
        <br></br>
        <div className="App">
      <header className="App-header">

        <p>
          E-BOOK
        </p>
        </header>
       </div> 
        <div style={styles}>

<Tab
  active={this.state.active}
  onChange={active => this.setState({active})}
>

 <div key="aTab">MECHANICAL</div>
  <div key="bTab">ELECTRONICS</div>
  <div key="cTab">COMPUTER SCIENCE</div>
  <div key="dTab">BASIC SCIENCE</div>
  <div key="eTab">EMBEDDED SYSTEMS</div>
  <div key="fTab">ADDITIONAL</div>
</Tab>



<br></br>
<p>{content[this.state.active]}</p>
</div>

<Switch>
      <Route path="ejournal/tab">
        <Tab />
      </Route>
</Switch> 

</>

        )

    }
}
export default Ebook;
